#1. Write function to sample from die
sample_die <- function()
{
    # randomly choose a number between 1 and 6
    sample(1:6,1, replace=T)
}

#2. Write a loop function to tally sucesses vs failures (define sucesses?)
suc_fail <- function(n)
{
    success <- 0
    failure <- 0

    for (i in 1:n){
        a <- sample_die()
        b <- sample_die()
        if (a == 6 & b == 6){
            success <- success + 1
        } else {
            failure <- failure + 1
        }
    }
    result <- list(success, failure)
    return (result)
}

#3. Run 10000 trials (24 throws 10000 times - 25 throws 10000 times) keeping track of successes vs faiures (from function 2)

trials <- function(times, throws)
{
    successes <- 0
    failures <- 0

    for (k in 1:times){
        trial_res <- suc_fail(throws)

        if (trial_res[[1]] >= 1){
            successes <- successes + 1
        } else{
            failures <- failures + 1
        }
    }

    final_result <- list(successes, failures)
    return (final_result)
}

