# de Mere was right that we have a better chance of winning the game with 25 throws. The chance of winning  
# is slightly over 50% when there are 25 throws. When there are only 24 throws, the chance of winning 
# is slightly under 50%.  
# Mathematically, it makes sense that there's a higher chance of success when there's 25 throws. 
# The probability formula creates larger probabilities for more throws. 
# The number of throws is equal to the exponent that is applied to the fraction of failures over possible outcomes. 
# After this term is evaluated, it is subtracted from 1 to obtain the probability.  
# Therefore, larger exponents makes the term smaller. As a result, a smaller value is subtracted from 1, and the
