#2. Write function to determine if in each 5 rolls we get all sixes (6*5)

allsixes <- function(n) {
    suc = 0

    for (k in 1:5){
        one_d = sample_die()

        if (one_d == 6){
            suc = suc + 1
        }
    }
    if (suc == 5){
        return("success")
    }
    else{
        return("failure")
    }
}

